const HomePage = () => {
  return (
    <div>
      <div className="containerWrapper">
        <div className={styles.mainGrid}>
          <div>
            <MainSlider />
          </div>
          <div>
            <News />
          </div>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
